@api.route('/firstAnalysis')
class FieldList(Resource):
    @api.doc('first_analysis')
    def post(self):
        payload = api.payload
        file_csv = payload.get('fileCSV')

        metadata = defaultdict(dict)
        file_csv = io.StringIO(file_csv)
        file_csv.readline()

        for line in file_csv:
            s = line.strip().split(",")
            cluster = s[0]
            seq_id = s[1]
            data = s[2]
            label = s[4]
            value = s[5]

            metadata[seq_id]['cluster'] = cluster
            metadata[seq_id]["date"] = data
            metadata[seq_id][label] = value

        # metadata = pd.DataFrame(metadata).T

        all_metadata = {}

        for line in metadata.items():
            for key, value in line[1].items():
                if key not in all_metadata:
                    all_metadata[key] = []
                found = False
                for item in all_metadata[key]:
                    if value == item['name']:
                        item['value'] = item['value'] + 1
                        found = True
                if not found:
                    all_metadata[key].append({'name': value, 'value': 1})
                # if key == 'cluster':
                #     sorted(all_metadata[key])
                # else:
                #     all_metadata[key].sort()

        return all_metadata




